result:
  .grid_tab {
    height: 39px;
    line-height: 39px;
    padding: 0 30px;
    border-bottom-width: 1px;
    border-bottom-style: solid;
  }
  .detail_title {
    border-bottom-width: 1px;
    border-bottom-style: solid;
    padding: 10px 40px;
    display: flex;
    justify-content: space-between;
  }
  .detail_content {
    padding: 20px 40px;
  }
  .detail_content_item {
    margin-bottom: 10px;
    display: flex;
    line-height: 15px;
  }
  .detail_content_item_key {
    width: 360px;
  }
  .title_item_head {
    margin-bottom: 6px;
    font-size: 12px;
    line-height: 16px;
  }
  .title_item_content {
    font-size: 16px;
    line-height: 22px;
  }
  .tab_item {
    display: inline-block;
    border-bottom-style: solid;
    border-bottom-width: 0px;
    height: 38px;
    cursor: pointer;
    user-select: none;
    margin-right: 36px;
    font-size: 14px;
  }
  .tab_item.a-12-bd {
    border-bottom-style: solid;
    border-bottom-width: 2px;
  }
  .trade-content .grid_class {
    height: 300px;
    overflow: auto;
  }
 .table-body .size_text {
    font-size: 14px;
  }
@keyframes drop-in {
  0% {
    /* // transform: translateY(-100%); */
    top: 35%;
    opacity: 0.7
  }
  100% {
    /* margin-top: 10px; */
    /* // transform: translateY(-50%); */
    opacity: 1;
  }
}
  .dialog_markAll {
    position: fixed;
    width: 100%;
    height: 100%;
    z-index: 999;
    top: 0;
    left: 0;
  }
  .dialog_frame {
    transform: 0.3s transition;
    position: fixed;
    z-index: 1000;
    left: 50%;
    top: 50%;
    transform: translate3d(-50%, -50%, 0);
    width: 800px;
    border-radius: 2px;
  }
  .dialog_frame_head {
    box-sizing: border-box;
    height: 60px;
    width: 100%;
    padding: 0 40px;
    line-height: 60px;
  }
  .dialog_frame_head_text {
    font-size: 16px;
  }
  .dialog_frame_head_close {
    float: right;
    cursor: pointer;
    font-size: 20px;
    margin-top: 12px;
  }
  .dialog_frame_body {
    padding-bottom: 50px;
  }
